                            Text = "\n                    <html lang=\"en\">\n                        <head>\n                        <meta charset=\"UTF-8\" />\n                        <title>Upcoming Event Reminder</title>\n                        <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n                        <style>\n                            body {\n                            margin: 0;\n                            padding: 0;\n                            background-color: #e0e0e0;\n                            font-family: Arial, sans-serif;\n                            }\n\n                            table {\n                            padding-top: 15px;\n                            width: 100%;\n                            background-color: #e0e0e0;\n                            }\n\n                            .email-container {\n                            width: 100%;\n                            max-width: 600px;\n                            background-color: #ffffff;\n                            border-radius: 6px;\n                            overflow: hidden;\n                            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);\n                            }\n\n                            .email-header {\n                            background-color: #ffffff;\n                            padding: 20px 40px;\n                            text-align: center;\n                            border-bottom: 4px solid #ea2839;\n                            }\n\n                            .email-header h1 {\n                            color: #ea2839;\n                            margin: 0;\n                            font-size: 26px;\n                            text-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);\n                            }\n\n                            .email-body {\n                            padding: 30px 40px;\n                            color: #333;\n                            }\n\n                            .email-body p {\n                            font-size: 16px;\n                            line-height: 1.5;\n                            }\n\n                            .email-body p strong {\n                            font-weight: bold;\n                            }\n\n                            .event-details {\n                            margin: 20px 0;\n                            padding: 12px 20px;\n                            background-color: #f5f5f5;\n                            border-radius: 4px;\n                            font-size: 16px;\n                            line-height: 1.5;\n                            }\n\n                            .email-footer {\n                            background-color: #1c394e;\n                            padding: 15px 40px;\n                            text-align: center;\n                            color: #ffffff;\n                            font-size: 13px;\n                            }\n\n                            .email-footer a {\n                            color: #ffffff;\n                            text-decoration: underline;\n                            }\n\n                            @media (max-width: 600px) {\n                            .email-container {\n                                width: 100%;\n                            }\n\n                            .email-header {\n                                padding: 15px 20px;\n                            }\n\n                            .email-header h1 {\n                                font-size: 22px;\n                            }\n\n                            .email-body {\n                                padding: 20px;\n                            }\n\n                            .email-body p {\n                                font-size: 14px;\n                            }\n\n                            .event-details {\n                                font-size: 14px;\n                                padding: 10px 15px;\n                            }\n\n                            .email-footer {\n                                padding: 15px 20px;\n                            }\n\n                            .email-footer a {\n                                font-size: 12px;\n                            }\n                            }\n\n                            @media (max-width: 400px) {\n                            .email-header h1 {\n                                font-size: 20px;\n                            }\n\n                            .email-body p {\n                                font-size: 13px;\n                            }\n\n                            .email-footer a {\n                                font-size: 11px;\n                            }\n                            }\n                        </style>\n                        </head>\n                        <body>\n                        <table>\n                            <tr>\n                            <td align=\"center\">\n                                <table\n                                width=\"100%\"\n                                cellspacing=\"0\"\n                                cellpadding=\"0\"\n                                class=\"email-container\"\n                                >\n                                <tr>\n                                    <td class=\"email-header\">\n                                    <h1>Event Reminder: {eventname}</h1>\n                                    </td>\n                                </tr>\n\n                                <tr>\n                                    <td class=\"email-body\">\n                                    <p>Hello <strong>{name}</strong>,</p>\n\n                                    <p>\n                                        This is a reminder that your upcoming event\n                                        <strong>{eventname}</strong> is just around the corner!\n                                    </p>\n\n                                    <div class=\"event-details\">\n                                        <strong>Date and Time:</strong><br />\n                                        {datetime}\n                                    </div>\n\n                                    <p>\n                                        We are looking forward to seeing you there. If you have any\n                                        questions or need further assistance, feel free to contact us.\n                                    </p>\n\n                                    <p>Best regards,<br /><em>Customer Support Team</em></p>\n                                    </td>\n                                </tr>\n\n                                <tr>\n                                    <td class=\"email-footer\">\n                                    This email address is not monitored. For support, contact\n                                    <a href=\"mailto:gym@polisenskydaniel.cz\"\n                                        >gym@polisenskydaniel.cz</a\n                                    >\n                                    </td>\n                                </tr>\n                                </table>\n                            </td>\n                            </tr>\n                        </table>\n                        </body>\n                    </html>"
                        });
